import React from "react";
import {Link} from "react-router-dom";
import "./style.css";

function Navbar(){
    return(
        <nav className="navbar"  >
            <div>
                <ul className="Navbar-nav">
                <li className="nav-item">
                        <Link
                          to="/"
                          className={
                              window.location.pathname=== "/" || window.location.pathname ==="/home"
                              ? "nav-link active"
                              : "nav-link"
                          }
                        >
                         Home
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link
                          to="/"
                          className={
                              window.location.pathname ==="/home" ? "nav-link active" : "nav-link"}
                        >
                         ABOUT
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link
                          to="/web development"
                          className={
                              window.location.pathname=== "/web development" ? "nav-link active": "nav-link"}
                        >
                         WEB DEVELOPMENT
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link
                          to="/web design"
                          className={
                              window.location.pathname=== "/web design" ? "nav-link active": "nav-link"}
                        >
                         WEB DESIGN & UI/UX
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link
                          to="/ARVR"
                          className={
                              window.location.pathname=== "/ARVR" ? "nav-link active": "nav-link"}
                        >
                         AR/VR 
                        </Link>
                    </li>



                </ul>

            </div>
        </nav>
    );
}

export default Navbar;
